import { ActionTypes } from "../constants/action-types"

const initialState = {
    images:[{id:1}],
};

export const imageReducer = (state, {type, payload}) => {
    switch(type){
        case ActionTypes.SET_IMAGES:
            return state;

        default:
            break;
    }
}
